import React from "react";
import LogoImg from "../../assets/logo.png";
import { Container, Logo, Menu } from "./styles";

const Header = () => {
    return (
        <Container>
            <Logo>
                <img src={LogoImg} alt="" />
            </Logo>
            <Menu>

            </Menu>
        </Container>
    )
}

export default Header;
